import java.io.BufferedReader;import java.io.FileNotFoundException;import java.io.FileReader;import java.io.IOException;import java.io.InputStream;import java.io.InputStreamReader;import java.io.PrintWriter;import java.util.*;public class Main{ 	public static void main(String[] args)  throws IOException, InterruptedException{		PrintWriter pw = new PrintWriter(System.out);		Scanner sc = new Scanner (System.in);				HashSet<String> po = new HashSet<>();		HashSet<String> en = new HashSet<>();		int n = sc.nextInt();		int m = sc.nextInt();int c = m ;		for(int i = 0 ; i < n ; i ++ ) po.add(sc.nextLine());		int order = 0 ;		for (int i = 0 ; i < m ; i ++ ) {						String s = sc.nextLine();			if (po.contains(s)) {								if (order %2 != 0 ) {					en.add(s); po.remove(s);  n-- ;order ++ ;							}else {					c--;					order ++ ;				}			}else {				en.add(s);			}		}				if (n > c ) pw.println("YES");		else pw.println("NO");		pw.close ();	}	static class Scanner {		StringTokenizer st;		BufferedReader br; 		public Scanner(InputStream s) {			br = new BufferedReader(new InputStreamReader(s));		} 		public Scanner(String file) throws FileNotFoundException {			br = new BufferedReader(new FileReader(file));		} 		public String next() throws IOException {			while (st == null || !st.hasMoreTokens())				st = new StringTokenizer(br.readLine());			return st.nextToken();		} 		public int nextInt() throws IOException {			return Integer.parseInt(next());		}		public long nextLong() throws IOException {			return Long.parseLong(next());		} 		public String nextLine() throws IOException {			return br.readLine();		}		public double nextDouble() throws IOException {			return Double.parseDouble(next());		} 		public boolean ready() throws IOException {			return br.ready();		} 	}  }	     				 	 					 	   	 		 	 	
